import React from 'react';
import './App.css';
import Homepage from "./pages/Homepage.js";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
function App() {
  return (
    <div className="App">
      <Router>
        <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/about">About</Link>
            </li>
            <li>
              <Link to="/contact">Contact</Link>
            </li>
          </ul>
        </nav>
        <Switch>
          <Route exact path="/" />
          <Route path="/about" />
          <Route path="/contact" />
        </Switch>
      </Router>
    </div>
  );
}

export default App;
